import React from "react";
import "./Sidebar.css";

const categories = [
  "Electronics",
  "Mobiles",
  "Laptops",
  "Fashion",
  "Home & Kitchen",
  "Books",
  "Sports",
];

const Sidebar = () => {
  return (
    <div className="sidebar">
      <ul>
        {categories.map((cat, index) => (
          <li key={index}>{cat}</li>
        ))}
      </ul>
    </div>
  );
};

export default Sidebar;
